import React from "react"

class Users extends React.Component {  //компонент
   users = [
    {
        id: 1,
        firstname: 'Боб',
        lastname: 'Иванов',
        bio: 'Строитель высшего ранга',
        age: 40,
        isHappy: true
    },
    {
        id: 2,
        firstname: 'Джон',
        lastname: 'Дорл',
        bio: 'Инженер',
        age: 22,
        isHappy: false
    }
   ]
    render(){
    return(<div>
        {this.users.map((el) => (<div className="user">
            <h3>{el.firstname} {el.lastname}</h3>
            <p>{el.bio}</p>
        </div>))}
    </div>
    
    )
   }
}

export default Users
